import React from "react";
import "./App.css";

function App() {
  const _getStreams = () => {
    var myHeaders = new Headers();
    myHeaders.append("Client-ID", "q4a4v5p2h4f78krp3cc088wln1u54j");

    var requestOptions = {
      method: "GET",
      headers: myHeaders,
      redirect: "follow"
    };

    fetch(
      "https://api.twitch.tv/helix/streams?first=5&user_login=mutheadtv",
      requestOptions
    )
      .then(response => response.text())
      .then(result => console.log(result))
      .catch(error => console.log("error", error));
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>Bronson Test</p>
        <button onClick={() => this._getStreams()}></button>
      </header>
    </div>
  );
}

export default App;
